import { useUserContext } from "./UserContext";


function App() {
    const { user, setUser } = useUserContext();

    return <div>
        <main>
            <NavBar user={user} setUser={setUser}/>
            <div className="body-div">
                <Outlet />
            </div>
        </main>
    </div>
}

export default App;
